import React, { useState } from "react";
import AccountCreation from "./AccountCreation";
import AccountEntitlement from "./AccountEntitlement";

function Dashboard() {
  const [creationPage, setCreationPage] = useState(false);
  const [entitilePage, setEntitilePage] = useState(false);
  return (
    <div>
      Dashboard
      {creationPage === true ? <AccountCreation /> : "Dashboard"}
      <button onClick={setCreationPage(true)}>Show Creation</button>
    </div>
  );
}

export default Dashboard;
